import Logo from './img/Logo.svg'

const Header = () => {
    return (
        <nav className="container navigation">
            <div className = "logo">
                <img src={Logo} alt="Logo" />
            </div>
            <div>
                <p>Home</p>
                <p>Products</p>
                <p>Promotions</p>
            </div>
            <div>

            </div>
        </nav>
    );
}

export default Header;
